import PropTypes from 'prop-types';
import Table from '../shared/Table/Table';

const columns = [
    {
        title: 'First Name',
        dataIndex: 'fistName',
    },
    {
        title: 'Last Name',
        dataIndex: 'lastName',
    },
    {
        title: 'Email',
        dataIndex: 'email',
    },
    {
        title: 'Password',
        dataIndex: 'password',
    },
];

const data = [
    {
        firstName: 'Jane',
        lastName: 'Cooper',
        title: 'Regional Paradigm Technician',
        department: 'Optimization',
        role: 'Admin',
        email: 'jane.cooper@example.com',
    },
    // {
    //     name: 'Jane Cooper',
    //     title: 'Regional Paradigm Technician',
    //     department: 'Optimization',
    //     role: 'Admin',
    //     email: 'jane.cooper@example.com',
    // },
];

const History = props => {
    return <Table columns={columns} dataSource={data} />;
};

History.propTypes = {};

export default History;
